                <h2> { activity.name } </h2>
                    {activity.map((parks) => (
                        <div className="park-list">
                            {parks.map((park) => (
                                <Link to={`/Parks/${park.parkCode}`}>
                                <h2>{ park.fullName }</h2>
                                </Link>
                            ))}
                        </div>

                    ))}
            </div>
          ))}
        </div>
      );
}

export default ActivityList;
